function ReviewListItem({item}){
    return(
        <div className="ReviewListItem">
            <img className="ReviewListItem-img" src={item.imgUrl} alt={item.title}/>
            <div>
                <h1>{item.title}</h1>
                <p>{item.rating}</p>
                <p></p>
                <p>{item.content}</p>
            </div>
        </div>
    )
}


function ReviewList({items}){
    console.log(items);
